import React from "react";

// css 
import style from './containerData.module.css';

interface Props {
    value: number,
    name: string,
    unite: string,
    imageUrl: string
}


export const ContainerData: React.FC<Props> = ({ value, name, unite, imageUrl }) => {
    return (
        <>
            <div className={style.containerData}>
                <div className={style.icon}></div>
                <p>{value}{unite}</p>
                <p>{name}</p>
            </div>
        </>
    );
}
